  return (
    <Grid display="flex" justifyContent="center" alignItems="center">
        <Box
          sx={{
            display: "flex",
            flexWrap: "wrap",
            p: 1,
            m: 1,
            bgcolor: "background.paper",
            maxWidth: 600,
            borderRadius: 1,
          }}
        >
    <Card sx={{ maxWidth: 345 }}>
      <p key={id}>{name}</p>
      <ExpandMore onClick={handleExpand}/>
